        //AddDocuments
        [HttpPost]
        public IActionResult AddCustomerDocument(CustomerDocument obj, IFormFile file)
        {
            try
            {
                var Msg = "";
                if (file != null && file.Length > 0)
                {
                    if (file != null)
                    {
                        var input = file.OpenReadStream();
                        var extension = Path.GetExtension(file.FileName);
                        if (extension == ".pdf" || extension == ".PDF")
                        {
                            byte[] byteData = null, buffer = new byte[input.Length];
                            using (MemoryStream ms = new MemoryStream())
                            {
                                int read;
                                while ((read = input.Read(buffer, 0, buffer.Length)) > 0)
                                {
                                    ms.Write(buffer, 0, read);
                                }
                                byteData = ms.ToArray();
                            }
                            obj.Image = byteData;
                        }
                    }
                }
                //"{\"DocumentId\":0,\"DocumentType\":\"2\",\"DocumentName\":\"texting\",\"Image\":\"\",\"ImageByPath\":null,\"SupplierId\":7}"

                var body = JsonConvert.SerializeObject(obj);

                SResponse resp = RequestSender.Instance.CallAPI("api", "Customer/CustomerDocumentCreate", "POST", body);
                if (resp.Status && (resp.Resp != null) && (resp.Resp != ""))
                {
                    Msg = "Add Successfully";
                    var jsonreturn = Json(resp.Status);
                    return jsonreturn;
                }
                else
                {
                    Msg = resp.Resp + " " + "Unable To Add";
                    return Json("false");
                }
            }
            catch (Exception ex)
            {
                return Json("false");
            }
        }

